(14, 3, 'en', 'Agency Approval Request', '<p><span style=\"font-size: 10pt;\">Hello <strong>Admin</strong>,&nbsp;</span><br /><span style=\"font-size: 10pt;\">A new Agency is registered on the {app_name} portal. Below are the details:</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Agency Detail</strong></span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Agency Name</strong>: {agency_name}, </span><br /><span style=\"font-size: 10pt;\"><strong>Registration Number</strong>: {registration_no}, </span><br /><span style=\"font-size: 10pt;\"><strong>Agency Website</strong>: {website}, </span><br /><span style=\"font-size: 10pt;\"><strong>Agency Whatsapp Number</strong>: {company_whatsapp}, </span><br /><span style=\"font-size: 10pt;\"><strong>General Manager Whatsapp</strong>: {GM_whatsapp}, </span><br /><span style=\"font-size: 10pt;\"><strong>Marketing Director Contact Number</strong>: {marketing_director_no}, </span><br /><span style=\"font-size: 10pt;\"><strong>Trade License Expiry</strong>: {trno_expiry}, </span><br /><span style=\"font-size: 10pt;\"><strong>Relational Manager Name</strong>: {relational_manager}, </span><br /><span style=\"font-size: 10pt;\"><strong>Agency Trade License Number</strong>: {agency_license_number}, </span><br /><span style=\"font-size: 10pt;\"><strong>Trade License Expiry Date</strong>: {trno_issue_place}, </span><br /><span style=\"font-size: 10pt;\"><strong>Agency Created By</strong>: {created_by}</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Bank Detail</strong></span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Bank Name</strong>: {bank_name}, </span><br /><span style=\"font-size: 10pt;\"><strong>Account Holder Name</strong>: {ac_name}, </span><br /><span style=\"font-size: 10pt;\"><strong>Branch Name</strong>: {branch_name}, </span><br /><span style=\"font-size: 10pt;\"><strong>Branch Address</strong>: {branch_address}, </span><br /><span style=\"font-size: 10pt;\"><strong>Currency</strong>: {currency}, </span><br /><span style=\"font-size: 10pt;\"><strong>Swift Code</strong>: {swift_code}, </span><br /><span style=\"font-size: 10pt;\"><strong>IBAN</strong>: {iban},</span></p>\r\n<p><span style=\"font-size: 10pt;\">Below are the Agency Attached Documnets</span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"{trade_license}\"> Trade License</a></span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"{passport}\"> Passport </a></span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"{emirates_id}\"> Emirates Id </a></span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"{rara_card}\"> Rara Card </a></span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"{trn_certificate}\"> Trn Certificate </a></span></p>\r\n<p><span style=\"font-size: 10pt;\"><a href=\"{rera_certificate}\"> Rera Certificate </a></span></p>\r\n<p><span style=\"font-size: 10pt;\">Please review the profile and issue the credentials: {app_url}</span></p>\r\n<p><span style=\"font-size: 10pt;\">Thanks,</span><br /><span style=\"font-size: 10pt;\">{app_name}</span></p>', NULL, '{\r\n                    \"App Name\": \"app_name\",\r\n                    \"Company Name\": \"agency_name\",\r\n                    \"App Url\": \"app_url\",\r\n                    \"Admin Name\" : \"admin_name\",\r\n                    \"Email\": \"email\",\r\n                    \"Registeration Number\": \"registration_no\",\r\n                    \"Agency Website\": \"website\",\r\n                    \"Agency Whatsapp Number\": \"company_whatsapp\",\r\n                    \"General Manager Whatsapp\": \"GM_whatsapp\",\r\n                    \"Marketing Director Contact Number\": \"marketing_director_no\",\r\n                    \"Bank Name\": \"bank_name\",\r\n                    \"Account Holder Name\": \"ac_name\",\r\n                    \"Branch Name\": \"branch_name\",\r\n                    \"Branch Address\": \"branch_address\",\r\n                    \"Currency\": \"currency\",\r\n                    \"Swift Code\": \"swift_code\",\r\n                    \"IBAN Number\": \"iban\",\r\n                    \"Trade License Expiry\": \"trno_expiry\",\r\n                    \"Relational Manager Name\": \"relational_manager\",\r\n                    \"Agency Trade License Number\": \"agency_license_number\",\r\n                    \"Trade License Expiry Date\": \"trno_issue_place\",\r\n                    \"Agency Created By\": \"created_by\",\r\n                    \"Trade License\" : \"trade_license\",\r\n                    \"Passport\" : \"passport\",\r\n                    \"Emirates Id\" : \"emirates_id\",\r\n                    \"Rara Card\" : \"rara_card\",\r\n                    \"Trn Certificate\" : \"trn_certificate\",\r\n                    \"Rera Certificate\" : \"rera_certificate\"\r\n                }', '2023-12-07 23:13:34', '2023-12-08 10:19:46'),
(15, 4, 'ar', 'Customer Invoice Send', '<p>مرحبا ، { invoice_name }</p>\r\n                    <p>مرحبا بك في { app_name }</p>\r\n                    <p>أتمنى أن يجدك هذا البريد الإلكتروني جيدا برجاء الرجوع الى رقم الفاتورة الملحقة { invoice_number } للخدمة / الخدمة.</p>\r\n                    <p>ببساطة اضغط على الاختيار بأسفل.</p>\r\n                    <p style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 18pt;\"><a style=\"background: #6676ef; color: #ffffff; font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-weight: normal; line-height: 120%; margin: 0px; text-decoration: none; text-transform: none;\" href=\"{invoice_url}\" target=\"_blank\" rel=\"noopener\"> <strong style=\"color: white; font-weight: bold; text: white;\">الفاتورة</strong> </a></span></p>\r\n                    <p>إشعر بالحرية للوصول إلى الخارج إذا عندك أي أسئلة.</p>\r\n                    <p>شكرا لك</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Regards,</p>\r\n                    <p>{ company_name }</p>\r\n                    <p>{ app_url }</p>', NULL, '{\r\n                    \"App Name\": \"app_name\",\r\n                    \"Company Name\": \"company_name\",\r\n                    \"App Url\": \"app_url\",\r\n                    \"Invoice Name\": \"invoice_name\",\r\n                    \"Invoice Number\": \"invoice_number\",\r\n                    \"Invoice Url\": \"invoice_url\"\r\n                  }', '2023-12-07 23:13:34', '2023-12-07 23:13:34'),
(16, 4, 'da', 'Customer Invoice Send', '<p>Hej, { invoice_name }</p>\r\n                    <p>Velkommen til { app_name }</p>\r\n                    <p>H&aring;ber denne e-mail finder dig godt! Se vedlagte fakturanummer { invoice_number } for product/service.</p>\r\n                    <p>Klik p&aring; knappen nedenfor.</p>\r\n                    <p style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 18pt;\"><a style=\"background: #6676ef; color: #ffffff; font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-weight: normal; line-height: 120%; margin: 0px; text-decoration: none; text-transform: none;\" href=\"{invoice_url}\" target=\"_blank\" rel=\"noopener\"> <strong style=\"color: white; font-weight: bold; text: white;\">Faktura</strong> </a></span></p>\r\n                    <p>Du er velkommen til at r&aelig;kke ud, hvis du har nogen sp&oslash;rgsm&aring;l.</p>\r\n                    <p>Tak.</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Med venlig hilsen</p>\r\n                    <p>{ company_name }</p>\r\n                    <p>{ app_url }</p>', NULL, '{\r\n                    \"App Name\": \"app_name\",\r\n                    \"Company Name\": \"company_name\",\r\n                    \"App Url\": \"app_url\",\r\n                    \"Invoice Name\": \"invoice_name\",\r\n                    \"Invoice Number\": \"invoice_number\",\r\n                    \"Invoice Url\": \"invoice_url\"\r\n                  }', '2023-12-07 23:13:34', '2023-12-07 23:13:34'),
(17, 4, 'de', 'Customer Invoice Send', '<p>Hi, {invoice_name}</p>\r\n                    <p>Willkommen bei {app_name}</p>\r\n                    <p>Hoffe, diese E-Mail findet dich gut! Bitte beachten Sie die beigef&uuml;gte Rechnungsnummer {invoice_number} f&uuml;r Produkt/Service.</p>\r\n                    <p>Klicken Sie einfach auf den Button unten.</p>\r\n                    <p style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 18pt;\"><a style=\"background: #6676ef; color: #ffffff; font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-weight: normal; line-height: 120%; margin: 0px; text-decoration: none; text-transform: none;\" href=\"{invoice_url}\" target=\"_blank\" rel=\"noopener\"> <strong style=\"color: white; font-weight: bold; text: white;\">Rechnung</strong> </a></span></p>\r\n                    <p>F&uuml;hlen Sie sich frei, wenn Sie Fragen haben.</p>\r\n                    <p>Vielen Dank,</p>\r\n                    <p>&nbsp;</p>\r\n                    <p>Betrachtet,</p>\r\n                    <p>{company_name}</p>\r\n                    <p>{app_url}</p>\r\n                    ', NULL, '{\r\n                    \"App Name\": \"app_name\",\r\n                    \"Company Name\": \"company_name\",\r\n                    \"App Url\": \"app_url\",\r\n                    \"Invoice Name\": \"invoice_name\",\r\n                    \"Invoice Number\": \"invoice_number\",\r\n                    \"Invoice Url\": \"invoice_url\"\r\n                  }', '2023-12-07 23:13:34', '2023-12-07 23:13:34'),
(18, 4, 'en', 'Customer Invoice Send', '<p><span style=\"color: #1d1c1d; font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; font-variant-ligatures: common-ligatures; background-color: #f8f8f8;\">Hi, {invoice_name}</span></p>\r\n                    <p><span style=\"color: #1d1c1d; font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; font-variant-ligatures: common-ligatures; background-color: #f8f8f8;\">Welcome to {app_name}</span></p>\r\n                    <p><span style=\"color: #1d1c1d; font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; font-variant-ligatures: common-ligatures; background-color: #f8f8f8;\">Hope this email finds you well! Please see attached invoice number {invoice_number} for product/service.</span></p>\r\n                    <p><span style=\"color: #1d1c1d; font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; font-variant-ligatures: common-ligatures; background-color: #f8f8f8;\">Simply click on the button below.</span></p>\r\n                    <p style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 18pt;\"><a style=\"background: #6676ef; color: #ffffff; font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-weight: normal; line-height: 120%; margin: 0px; text-decoration: none; text-transform: none;\" href=\"{invoice_url}\" target=\"_blank\" rel=\"noopener\"> <strong style=\"color: white; font-weight: bold; text: white;\">invoice</strong> </a></span></p>\r\n                    <p><span style=\"color: #1d1c1d; font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; font-variant-ligatures: common-ligatures; background-color: #f8f8f8;\">Feel free to reach out if you have any questions.</span></p>\r\n                    <p><span style=\"color: #1d1c1d; font-family: Slack-Lato, Slack-Fractions, appleLogo, sans-serif; font-size: 15px; font-variant-ligatures: common-ligatures; backg