(158, 23, 'en', 'NOC and Brokerage Documents Issued', '<p>Dear {name_of_agency} </p>\n\n                    <p>I hope this message finds you well. We are pleased to inform you that your agencys access to our CRM system has been successfully approved. This means that you can now effectively engage in selling Empire properties through our platform.</p>\n                    \n                    <p>Here are the credentials required for accessing the CRM:</p>\n                    \n                    <p>Username: {agency_email}<br>\n                    Password: {agency_password}</p>\n                </p>\n                   \n                    <p>We kindly request that you review, sign, and upload the Brokerage Agreement on the CRM. This will ensure smooth collaboration and facilitate the process of selling Empire properties through our platform.</p>\n                    \n                    <p>Thank you for your cooperation. We look forward to a fruitful partnership.</p>\n                    \n                    <p>Regards,</p>\n                    \n                    <p>{app_name}</p>\n                    ', NULL, '{\n                    \"Name Of Agency\" : \"name_of_agency\",\n                    \"Agency Email\" : \"agency_email\",\n                    \"password\" : \"agency_password\",\n                    \"App Name\" : \"app_name\",\n                  }', '2024-01-01 07:21:17', '2024-01-01 07:21:17');
